static Fl_Pixmap image_splash2(idata_splash2);

inline void CSplashFrame::cb_btnClose_i(Fl_Button*, void*) {
  wndSplash->hide();
}
void CSplashFrame::cb_btnClose(Fl_Button* o, void* v) {
  ((CSplashFrame*)(o->parent()->user_data()))->cb_btnClose_i(o,v);
}

CSplashFrame::CSplashFrame() {
  Fl_Window* w;
  { Fl_Window* o = wndSplash = new Fl_Window(402, 302);
    w = o;
    o->user_data((void*)(this));
    { Fl_Box* o = boxImage = new Fl_Box(0, 0, 402, 302);
      o->image(image_splash2);
    }
    { Fl_Button* o = btnClose = new Fl_Button(339, 269, 55, 25, "Close");
      o->box(FL_THIN_UP_FRAME);
      o->down_box(FL_THIN_DOWN_FRAME);
      o->labelsize(12);
      o->labelcolor(7);
      o->callback((Fl_Callback*)cb_btnClose);
    }
    o->clear_border();
    o->end();
  }
}

void CSplashFrame::show() {
  if (m_timer)
	Fl::add_timeout(4.0,cbHide,(void*)wndSplash);

wndSplash->show();
}

void CSplashFrame::center() {
  wndSplash->position(Fl::w()/2-wndSplash->w()/2,Fl::h()/2-wndSplash->h()/2);
}

void CSplashFrame::setTimer(bool flag) {
  m_timer = flag;
}

void CSplashFrame::hide() {
  wndSplash->hide();
}
